webpackJsonp([40562248833247],{362:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Today marks another step forward in my path to web development. Here is an interactive slider I built using html, CSS, javascript, and jQuery. To accompish the task I followed a short series of <a href="https://www.youtube.com/watch?v=QtYP_eSVKfs">video tutorials</a>. The main takeaway from the tutorial is the use of jQuery.</p>\n<p>In short, jQuery is a javascript library and a great shortcut to making an interactive website. While following the videos, I noticed that some of the content was outdated so I had to scroll through this <a href="http://overapi.com/jquery">jQuery cheatsheet</a> to get some parts working properly.</p>\n<p>Should you decide to attempt the tutorial yourself be sure to change the bit about \'.size()\' to \'.length\' (and yes I purposely excluded the \'()\' in .length).</p>\n<p>Without further ado here\'s the slider.</p>\n<iframe width="100%" height="720px" frameborder="0" src="https://rboshae.github.io/Personal-Website-1//projects/slider/index.html">\n  <p>Your browser does not support iframes.</p>\n</iframe>\n ',frontmatter:{title:"jQuery Interactive Slider"}}},pathContext:{slug:"/2017-07-31-rick-boshae-jQuery-Interactive-Slider - Copy/"}}}});
